// Классовый компонент PopupWithForm
import React from 'react';


export class PopupWithForm extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className={`popup popup_type_${this.props.name}`}>
                <form className="popup__container" name={`${this.props.name}`} noValidate>
                    <button className="button button_type_close" type="button"></button>
                    <h2 className="popup__title">{this.props.title}</h2>
                    {this.props.children}
                </form>
            </div>
        );
    }
}
